function GetFacilityData(FacilityID, Attribute) {
	if (FacilityInfoMap[String(FacilityID)] == undefined) { return 0; }
	return FacilityInfoMap[String(FacilityID)][Attribute];
}
function IsDecorative(FacilityID) {
	if (FacilityInfoMap[String(FacilityID) + "00"] != undefined && FacilityInfoMap[String(FacilityID) + "01"] == undefined) { return true; }
	return false;
}
function IsIncome(FacilityID) {
	if (FacilityID == 100201 || FacilityID == 100301) { return true; }
	return false;
}

function CalculateAverage99(List) {
	const Element1Index = List.findIndex(x => x.elemental_type == 1);
	const Element2Index = List.findIndex(x => x.elemental_type == 2);
	const Element3Index = List.findIndex(x => x.elemental_type == 3);
	const Element4Index = List.findIndex(x => x.elemental_type == 4);
	const Element5Index = List.findIndex(x => x.elemental_type == 5);
	const Element99Index = List.findIndex(x => x.elemental_type == 99);
	
	const HPAverage = (List[Element1Index]['hp'] + List[Element2Index]['hp'] +
					   List[Element3Index]['hp'] + List[Element4Index]['hp'] +
					   List[Element5Index]['hp']) / 5;
	List[Element99Index]['hp'] = HPAverage;
					  
	const AtkAverage = (List[Element1Index]['attack'] + List[Element2Index]['attack'] +
					    List[Element3Index]['attack'] + List[Element4Index]['attack'] +
					    List[Element5Index]['attack']) / 5;
	List[Element99Index]['attack'] = AtkAverage;
					   
	if (List[0]['dragon_bonus'] != undefined) {
		const DDmgAverage = (List[Element1Index]['dragon_bonus'] + List[Element2Index]['dragon_bonus'] +
							 List[Element3Index]['dragon_bonus'] + List[Element4Index]['dragon_bonus'] +
							 List[Element5Index]['dragon_bonus']) / 5;
		List[Element99Index]['dragon_bonus'] = DDmgAverage;
	}
	return List;
}

